            <div className="container text- center">
                <div className="text-center">
                <h3>ABOUT US</h3>
                <p>AOWSAY creates amazing games that make an emotional impact on gamers around the world!</p>
                <br/>
                <h3 >THE TEAM</h3>
                <hr/>
                </div>
            </div>                
        </Layout>        
    )
}

export default About;
